  const [isHovered, setHovered] = useState(false);
  return (
      <div className="page">
        <motion.div 
          animate={{opacity: [0, 1]}} 
          whileHover={() => setHovered(true)}
          //whileHover={{color: ["#000000","#ef4824"]}}
        >
          <div className="text">
            زاك
          </div>
          <div className="text">
            ZACH HUSSEIN
          </div>
        </motion.div>

        <Link to="home" className="smalltext">ENTER</Link>
      </div>
  )
}

export default FrontPage
